import React, { useContext } from "react";
import Sucbscription from "./Sucbscription";
import ServiceBooking from "./ServiceBooking";
import { CompanyServiceList } from "../../companyData";

// STYLING
import "./popUpStyles/popUpHandler.css";

function PopUpsHandler(props) {
  const { servicepPopUp,} = useContext(CompanyServiceList);

  return (
    <div
      className={
        servicepPopUp
          ? "popUpContainer"
          : "popUpContainer popUpContainerDeActivate"
      }>
      <div className="popUpWrapper">
        <ServiceBooking />
        <Sucbscription />
      </div>
    </div>
  );

}

export default PopUpsHandler;
